it takes courage and it changes everything. once your toes are dipped there‚Äôs no way back, and you realize that life is grander than you ever thought possible. let‚Äôs continue unlearning and bringing new life. let‚Äôs rise together and create community and collaboration. this unlearning business is hard, but omg is it exhilarating. üî•‚ù§Ô∏è

